import React from 'react'
import "./Post.css"
import Avatar from '@material-ui/core/Avatar';

class Post extends Component {
    render(){
        return (
        <div className="post">
            <Avatar
            className="post__avatar"
            alt="RemySharp"
            src="https://picsum.photos/536/354"  />


            <h3>Username</h3>
            <img className="post__image" src="https://picsum.photos/536/354" alt="" />
            <h4 className="post__text"><b>Donald</b>: Random pictures</h4>
        </div>
    )}
}

export default Post
